Canadian beauty brands are my secret weapon for that 'abootiful' glow🤓🥳.

BIG cheers to embracing the True North glow with some stellar Canadian beauty buys🙌🏽🙌🏽🙌🏽.

Supporting local never looked this good while being so kind in keeping Mother Earth beautiful too! 🍁✨

@sahajanskincare is the first clean and clinically proven Ayurvedic skin, hair, and body line, and they're based in Toronto! The beauty brand was founded by former pharmaceutical exec Lisa Mattam, making it the perfect pairing of ancient Ayurvedic wisdom and modern science. 

@elatecosmetics is female founded and owned in Victoria, BC. Their new Capsule Beauty collection is vegan, cruelty free, and ethically sourced with sustainable packaging. The Refresh Foundation I'm using comes in a refillable and reusable glass bottle with a recyclable plastic pump and ashwood lid. Very eco-friendly!

@upfrontcosmetics is also female founded and owned, based in Fredericton, New Brunswick, where all their products are hand-made too. Their shampoo and conditioner bars replace up to 3 bottles of liquid shampoo and conditioner, and are made with 6 grams of purely plant-based nutrient richness. No water weight or plastic bottle!

